                    "description": {
                        "content": "The delightful Hotel Servatur Don Miguel is located on the island of Gran Canaria, Spain, which is a small continent that offers you everything from desert landscapes to exuberant vegetation. \n\nWhen you arrive at this comfortable hotel, you'll find it easy to escape from the hustle and bustle of the city and leave behind all your worries. The friendly staff and service create a familiar atmosphere to guarantee you peaceful holidays in this ADULTS ONLY (over 18)  hotel . The hotel offers activities like  pool  and tennis. In the surrounding area, you'll also find the option to try out water sports, play mini golf, squash or rent a bike. For golf lovers there are two courses near the hotel with several routes and difficulties. \n\nDuring the week you can enjoy the entertainment programme and live music. The resort includes a fresh water swimming pool, a solarium-terrace and a snack bar to cool down with a drink. \n\nThe cuisine of Gran Canaria is an authentic ocean of flavours and aromas that has influences from all over the world, including a range of fruits, vegetables and fresh seafood. In the “à la carte” restaurant (not avilable at the moment) and exquisite buffet restaurant you'll find the best local and international recipes, with many dishes prepared using healthy ingredients. (Half board: drinks not included in dinner) \n\nAt Playa del Inglés sun and fun accompany you all day long, with sporting activities such as jet skiing, windsurfing, sailing and much more. Close to the beach you'll find beach bars, souvenir shops, bars, restaurants and clubs where you can enjoy great beats all night long. If you want to discover the surroundings you can take a walk along the Paseo Costa Canaria coastal path, that passes through tropical flora or you can discover places such as Playa de las Burras beach, the dunes of Maspalomas.\n\nAs a result of local government guests may find that some facilities or services are not available."
                    },
